import * as React from "react";
import { TextField, Slider, Grid, Box } from "@mui/material";

// const handleChange = (event, newValue) => {
//    setValue(newValue);
//  };

class Inputs extends React.Component {

    render () {

        // const [value, setValue] = React.useState(50);

        return (
            <div className="Inputs">
                <header className="Inputs-header">
                    <Box sx={{
                        bgcolor: 'background.paper',
                        boxShadow: 1,
                        borderRadius: 1,
                        p: 2,
                        minWidth: 300,
                    }} >
                        Safe Withdrawal Rate Calculator
                        <Grid container spacing={4} >
                            <Grid item xs={12}>
                            </Grid>
                            <Grid item xs={4}>
                                <TextField required label="Portfolio Value" defaultValue="1000000" />
                            </Grid>
                            <Grid item xs={4}>
                                <TextField required label="Annual Spend" defaultValue="40000" />
                            </Grid>
                            <Grid item xs={8}>
                                <Slider label="Stock Allocation" value={80}  />
                            </Grid>
                        </Grid>
                    </Box>

                </header>
            </div>
        );
    }
}

  export default Inputs;
